import Cards from '../../components/Cards/Cards'
import style from './Home.module.css'


const Home = ({characters, onClose}) =>{
    return (
        <div>
            <div className={style.image}>
                <h1 className={style.title}>Rick And Morty App</h1>
                <p className={style.description}>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Corporis in fugiat animi ipsa alias? Tempore obcaecati molestias iste commodi, voluptatibus dolores cum accusantium optio, ab esse ea aperiam enim velit.</p>
                
            </div>
            {characters.length === 0 && <h1 className={style.mensaje}>No tienes ningun personaje cargado</h1>}
            <Cards characters={characters}
                    onClose={onClose}></Cards>
        </div>
    )
}

export default Home
